import React from "react";
import { Carousel } from "react-responsive-carousel";

export default () => (
    
  <Carousel autoPlay>
      
    <div style={{height:'30%'}}>
      <img src="https://code.org/shared/images/social-media/codeorg2019_social.png" />
      
    </div>
    <div style={{height:'30%'}}>
      <img src="https://code.org/shared/images/social-media/codeorg2019_social.png" />
      
    </div>
    <div style={{height:'35%'}}>
      <img src="http://lorempixel.com/output/cats-q-c-640-480-3.jpg" />
      
    </div>
    
    
  </Carousel>
);
